/*Table structure for table `aftersales` */

DROP TABLE IF EXISTS `aftersales`;

CREATE TABLE `aftersales` (
  `dtype` varchar(31) NOT NULL,
  `id` bigint(20) NOT NULL,
  `createdDate` datetime NOT NULL,
  `lastModifiedDate` datetime NOT NULL,
  `version` bigint(20) NOT NULL,
  `deliveryCorp` varchar(255) DEFAULT NULL,
  `deliveryCorpCode` varchar(255) DEFAULT NULL,
  `reason` longtext NOT NULL,
  `status` int(11) NOT NULL,
  `trackingNo` varchar(255) DEFAULT NULL,
  `account` varchar(255) DEFAULT NULL,
  `bank` varchar(255) DEFAULT NULL,
  `method` int(11) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `area` varchar(255) DEFAULT NULL,
  `consignee` varchar(255) DEFAULT NULL,
  `phone` varchar(255) DEFAULT NULL,
  `member_id` bigint(20) NOT NULL,
  `store_id` bigint(20) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `ind_Aftersales_member_id` (`member_id`),
  KEY `ind_Aftersales_store_id` (`store_id`),
  CONSTRAINT `FK6w4ca9x75qadllvsgohahi5tu` FOREIGN KEY (`store_id`) REFERENCES `store` (`id`),
  CONSTRAINT `FK9g2ha5glwo48nlmhnd9wtnuop` FOREIGN KEY (`member_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `aftersales` */

/*Table structure for table `aftersalesitem` */

DROP TABLE IF EXISTS `aftersalesitem`;

CREATE TABLE `aftersalesitem` (
  `id` bigint(20) NOT NULL,
  `createdDate` datetime NOT NULL,
  `lastModifiedDate` datetime NOT NULL,
  `version` bigint(20) NOT NULL,
  `quantity` int(11) NOT NULL,
  `aftersales_id` bigint(20) NOT NULL,
  `orderItem_id` bigint(20) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `ind_AftersalesItem_aftersales_id` (`aftersales_id`),
  KEY `ind_AftersalesItem_orderItem_id` (`orderItem_id`),
  CONSTRAINT `FKdrl25vsrruo23wp7xjbdqrvd0` FOREIGN KEY (`orderItem_id`) REFERENCES `orderitem` (`id`),
  CONSTRAINT `FKsrb80j3glv5ol5vpf1gts8s99` FOREIGN KEY (`aftersales_id`) REFERENCES `aftersales` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

