  `shippingMethod_id` bigint(20) NOT NULL,
  `store_id` bigint(20) NOT NULL,
  `area_id` bigint(20) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `ind_AreaFreightConfig_shippingMethod_id` (`shippingMethod_id`),
  KEY `ind_AreaFreightConfig_store_id` (`store_id`),
  KEY `ind_AreaFreightConfig_area_id` (`area_id`),
  CONSTRAINT `FK8b8uapi3pw83xpduh3n03hn9d` FOREIGN KEY (`area_id`) REFERENCES `area` (`id`),
  CONSTRAINT `FKm3lakq890m3iu8vwx7cykrkwe` FOREIGN KEY (`shippingMethod_id`) REFERENCES `shippingmethod` (`id`),
  CONSTRAINT `FKqra3byee50q665a05mh5blt02` FOREIGN KEY (`store_id`) REFERENCES `store` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

