/*Table structure for table `brand` */

DROP TABLE IF EXISTS `brand`;

CREATE TABLE `brand` (
  `id` bigint(20) NOT NULL,
  `createdDate` datetime NOT NULL,
  `lastModifiedDate` datetime NOT NULL,
  `version` bigint(20) NOT NULL,
  `orders` int(11) DEFAULT NULL,
  `introduction` longtext,
  `logo` varchar(255) DEFAULT NULL,
  `name` varchar(255) NOT NULL,
  `type` int(11) NOT NULL,
  `url` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `brand` */

insert  into `brand`(`id`,`createdDate`,`lastModifiedDate`,`version`,`orders`,`introduction`,`logo`,`name`,`type`,`url`) values (1,'2019-07-12 00:05:42','2019-07-12 00:05:42',0,1,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 苹果公司(Apple Inc. )是美国的一家高科技公司。由史蒂夫·乔布斯、斯蒂夫·沃兹尼亚克和罗·韦恩(Ron Wayne)等人于1976年4月1日创立，并命名为美国苹果电脑公司(Apple Computer Inc. )，2007年1月9日更名为苹果公司，总部位于加利福尼亚州的库比蒂诺。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 苹果公司1980年12月12日公开招股上市，2012年创下6235亿美元的市值记录，截至2014年6月，苹果公司已经连续三年成为全球市值最大公司。苹果公司在2016年世界500强排行榜中排名第9名。2013年9月30日，在宏盟集团的“全球最佳品牌”报告中，苹果公司超过可口可乐成为世界最有价值品牌。2014年，苹果品牌超越谷歌(Google)，成为世界最具价值品牌。<br>2016年7月20日，《财富》世界500强排行榜，苹果公司名列第九名 。2016年9月8日凌晨1点，2016苹果秋季新品发布会在美国旧金山的比尔·格雷厄姆市政礼堂举行 。10月，苹果公司成为2016年全球100大最有价值品牌第一名。2017年1月6日早晨8点整，“红色星期五”促销活动在苹果官网正式上线，瞬间大量用户涌入官网进行抢购，仅两分钟所有参与活动的耳机便被抢光。2017年2月，Brand Finance发布2017年度全球500强品牌榜单，苹果公司排名第二。2017年6月7日，2017年《财富》美国500强排行榜发布，苹果公司排名第3位。2017年7月20日，2017年世界500强排名第9位。2017天猫双十一“亿元俱乐部”榜单显示，苹果位列第一名。</p>','http://image.demo.b2b2c.shopxx.net/6.0/210ca72b-1ae7-4026-b76c-21463bb1722b.png','苹果',1,'http://www.apple.com'),(2,'2019-07-12 00:05:43','2019-07-12 00:05:43',0,2,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 北京小米科技有限责任公司成立2010年4月，是一家专注于智能硬件和电子产品研发的移动互联网公司。“为发烧而生”是小米的产品概念。小米公司创造了用互联网模式开发手机操作系统、发烧友参与开发改进的模式。小米还是继苹果、三星、华为之后第四家拥有手机芯片自研能力的科技公司。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; “让每个人都能享受科技的乐趣”是小米公司的愿景。小米公司应用了互联网开发模式开发产品的模式，用极客精神做产品，用互联网模式干掉中间环节，致力让全球每个人，都能享用来自中国的优质科技产品。</p>','http://image.demo.b2b2c.shopxx.net/6.0/cbc4fa6f-3a14-42c7-a554-49c8cce7c446.png','小米',1,'http://www.mi.com'),(3,'2019-07-12 00:05:44','2019-07-12 00:05:44',0,3,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 三星集团是韩国最大的跨国企业集团，同时也是上市企业全球500强，三星集团包括众多的国际下属企业，旗下子公司有：三星电子、三星物产、三星航空、三星人寿保险等，业务涉及电子、金融、机械、化学等众多领域。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 三星集团成立于1938年，由李秉喆创办。三星集团是家族企业，李氏家族世袭，旗下各个三星产业均为家族产业，并由家族中的其他成员管理，集团领导人已传至 李氏第三代，李健熙为现任集团会长，其子李在镕任三星电子副会长。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2016年5月25日，华为公司在美国和中国提起对三星公司的知识产权诉讼，包括加州北区法院和深圳中级人民法院。7月21日，三星在北京知识产权法院起诉华为技术有限公司专利侵权，停止生产、销售mate8等机型，索赔8050万。9月6日，据道琼斯消息，在已出货或到达消费者手中的约250万部Note 7手机中，有70%电池为由子公司：三星SDI(SAMSUNG SDI CO.,LTD.)供应，剩下的部分则采用了中国新能源科技有限公司(ATL)的电池。10月，三星集团排2016年全球100大最有价值品牌第7名。10月，三星电子在召回Galaxy Note 7手机后又宣布停止销售该手机，几乎宣布了这款旗舰手机的“死刑”，此举或令三星损失170亿美元 。12月9日，三星准备在美国升级软件，永久禁用Galaxy Note7手机。 <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2016年11月4日晚间消息，三星电子美国公司宣布，将主动召回280万台特定型号的顶部开盖洗衣机。</p>','http://image.demo.b2b2c.shopxx.net/6.0/d2f3d6d1-02fd-4f04-9329-f180e12885e7.png','三星',1,'http://www.samsung.com'),(4,'2019-07-12 00:05:45','2019-07-12 00:05:45',0,4,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 华为技术有限公司是一家生产销售通信设备的民营通信科技公司，于1987年正式注册成立，总部位于中国深圳市龙岗区坂田华为基地。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 华为是全球领先的信息与通信技术(ICT)解决方案供应商，专注于ICT领域，坚持稳健经营、持续创新、开放合作，在电信运营商、企业、终端和云计算等领域构筑了端到端的解决方案优势，为运营商客户、企业客户和消费者提供有竞争力的ICT解决方案、产品和服务，并致力于使能未来信息社会、构建更美好的全联接世界。2013年，华为首超全球第一大电信设备商爱立信，排名《财富》世界500强第315位。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 截至2016年底，华为有17万多名员工，华为的产品和解决方案已经应用于全球170多个国家，服务全球运营商50强中的45家及全球1/3的人口。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2016年8月，全国工商联发布“2016中国民营企业500强”榜单，华为以3950.09亿元的年营业收入成为500强榜首。8月，华为在\"2016中国企业500强\"中排名第27位。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2017年6月6日，《2017年BrandZ最具价值全球品牌100强》公布，华为名列第49位。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2017年6月30日，华为技术有限公司荣获中国商标金奖的马德里商标国际注册特别奖。 <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 美国《财富》杂志发布了最新一期的世界500强名单 。华为以785.108亿美元营业收入首次打入前百强，排名第83位，较上一年的第129位提升46位。联想营企业500强”榜单，联想名列第四。</p>','http://image.demo.b2b2c.shopxx.net/6.0/0ac3f886-754d-4a25-a0a3-195fd0ec86dd.png','华为',1,'http://www.huawei.com'),(5,'2019-07-12 00:05:46','2019-07-12 00:05:46',0,5,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 联想集团是1984年中国科学院计算技术研究所投资20万元人民币，由11名科技人员创办，是中国的一家在信息产业内多元化发展的大型企业集团，和富有创新性的国际化的科技公司。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 从1996年开始，联想电脑销量一直位居中国国内市场首位；2005年，联想集团收购IBM PC(Personal computer，个人电脑)事业部；2013年，联想电脑销售量升居世界第一，成为全球最大的PC生产厂商。2014年10月，联想集团宣布了该公司已经完成对摩托罗拉移动的收购。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 作为全球电脑市场的领导企业，联想从事开发、制造并销售可靠的、安全易用的技术产品及优质专业的服务，帮助全球客户和合作伙伴取得成功。联想公司主要生产台式电脑、服务器、笔记本电脑、智能电视、打印机、掌上电脑、主板、手机、一体机电脑等商品。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 自2014年4月1日起， 联想集团成立了四个新的、相对独立的业务集团，分别是PC业务集团、移动业务集团、企业级业务集团、云服务业务集团。2016年8月，全国工商联发布“2016中国民营企业500强”榜单，联想名列第四。</p>','http://image.demo.b2b2c.shopxx.net/6.0/a1b69d2d-4804-4881-a936-38a66819b656.png','联想',1,'http://www.lenovo.com.cn'),(6,'2019-07-12 00:05:47','2019-07-12 00:05:47',0,6,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 锤子手机是由罗永浩创办的锤子科技研发的一款中高端智能手机。“锤子手机”是指由锤子科技(北京)有限公司设计与研发的一系列高端智能手机。锤子手机采用基于 Android定制的 Smartisan OS 智能手机操作系统。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2016年10月18日晚 19:30，锤子科技召开了2016 年秋季新品发布会，正式推出了锤子品牌的第三代手机：Smartisan M1 和 Smartisan M1L。</p>','http://image.demo.b2b2c.shopxx.net/6.0/e5d7fca1-9270-4447-88cb-18b40a7090e8.png','锤子',1,'http://www.smartisan.com'),(7,'2019-07-12 00:05:48','2019-07-12 00:05:48',0,7,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 魅族，是智能手机厂商魅族科技有限公司的简称，成立于2003年3月；是一家国内外知名智能手机厂商，总部位于中国广东省珠海市。公司致力于向消费者提供国际一流性能和品质的电子产品，并立足于中高端市场。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 魅族手机系列成为国产智能手机创新精品，主要产品有魅族PRO6 Plus、魅族PRO6s、魅族MX6、魅族PRO6、魅族PRO5、魅族MX5、魅蓝E系列、魅蓝X、魅蓝5s、魅蓝5、魅蓝note5、魅蓝note3、魅蓝metal、魅蓝note2、魅蓝3S、魅蓝3等系列手机。魅族深谙“产品大于商业”之理念，对智能手机给出了“ J.Wong 式”的定义，追求细节，稳中求变。旗下Flyme系统是魅族设计理念在软件更深层上的体现，也是魅族手机的核心竞争力之一，被魅族称为“产品的灵魂所在”。事实上，截至目前为止，魅族 在全国一共拥有2000多家专卖店，产品在中国大陆、香港、台湾、俄罗斯、英国、法国、德国、意大利、乌克兰、以色列、捷克斯洛伐克、马来西亚、印度、印尼等国家和地区销售，魅族一直积极部署更为深入的海外市场战略。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2014年10月，魅族科技联合阿里巴巴在北京举行发布会，宣布双方达成战略合作。2015年2月，魅族科技获阿里巴巴5.9亿美元投资；9月，魅族新品邀请函而来的有一部GoPro产品。李楠解释选择GoPro是因为，GoPro的发音分开来看是“GO Pro”，走向PRO，PRO将是未来魅族高端子品牌的名称。根据魅族发展策略，目前魅族已拥有「魅族PRO」高端品牌、「魅族MX」中端机型以及「魅蓝」子品牌三个产品系列。</p>','http://image.demo.b2b2c.shopxx.net/6.0/799568d8-29e4-4199-aa0a-53733aa1a529.png','魅族',1,'http://www.meizu.com'),(8,'2019-07-12 00:05:49','2019-07-12 00:05:49',0,8,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 索尼(日语：ソニー株式会社，英语：Sony Corporation)，是日本一家全球知名的大型综合性跨国企业集团。总部设于日本东京都港区港南1-7-1。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 索尼是世界视听、电子游戏、通讯产品和信息技术等领域的先导者，是世界最早便携式数码产品的开创者，是世界最大的电子产品制造商之一、世界电子游戏业三大巨头之一、美国好莱坞六大电影公司之一。其旗下品牌有Xperia，Walkman，Sony music，哥伦比亚电影公司，PlayStation等<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 曾有vaio旗下品牌，但在2014年2月6日，索尼剥离VAIO业务，Vaio品牌将由Japan Industrial Partners Inc接手运营。</p>','http://image.demo.b2b2c.shopxx.net/6.0/6fb55d52-8925-4208-a05b-225b44cfbcf4.png','索尼',1,'http://www.sony.com.cn'),(9,'2019-07-12 00:05:50','2019-07-12 00:05:50',0,9,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; OPPO是更多年轻人选择的拍照手机品牌。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 国产手机越来越受青睐，在中国，更多年轻人选择OPPO拍照手机。十年来，OPPO一直专注手机拍照的技术创新，开创了“手机自拍美颜”时代；全球超过2亿年轻人正在使用OPPO拍照手机。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 据权威数据机构IDC统计，OPPO 2016年已成为中国手机市场出货量第一。</p>','http://image.demo.b2b2c.shopxx.net/6.0/705a01e5-1b34-435e-873b-b6c758aba1be.png','OPPO',1,'http://www.oppo.com'),(10,'2019-07-12 00:05:51','2019-07-12 00:05:51',0,10,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; vivo为一个专注于智能手机领域的手机品牌，vivo和追求乐趣、充满活力、年轻时尚的群体一起打造拥有卓越外观、专业级音质、极致影像、愉悦体验的智能产品，并将敢于追求极致、持续创造惊喜作为vivo的坚定追求。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2014年vivo品牌的国际化之路全面开启，除中国大陆市场外，vivo进驻的海外市场包含印度、泰国、缅甸、马来西亚、印度尼西亚、越南和菲律宾。2016-2017年，vivo正式成为NBA中国官方合作伙伴。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2016年底，vivo高层在媒体沟通会上透露，将在国内外成立研发中心，国内部分有深圳、东莞长安、南京、杭州和北京，而在国外将在美国圣地亚哥分设研发中心。vivo将由原来的音乐和拍照的单点技术突破很可能将变成从智能手机的整体技术创新全面推进。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2017年5月31日，vivo在京宣布将连续成为2018年及2022年两届世界杯全球官方赞助商。借助世界杯足球赛这一顶级赛事，vivo也将进一步提升国际影响力，扎实海外布局步伐，为未来品牌出海计划做铺垫。</p>','http://image.demo.b2b2c.shopxx.net/6.0/5db067fe-8341-4d40-86e2-f83418e37569.png','VIVO',1,'http://www.vivo.com.cn'),(11,'2019-07-12 00:05:52','2019-07-12 00:05:52',0,11,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 华旗资讯旗下的子品牌爱国者的英文商标。</p>','http://image.demo.b2b2c.shopxx.net/6.0/bc6f521a-4427-44e3-a1f0-fb4f6cb9e381.png','爱国者',1,'http://www.aigochina.com'),(12,'2019-07-12 00:05:53','2019-07-12 00:05:53',0,12,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 图拉斯(TORRAS)是蓝禾集团有限公司旗下一个集研发、设计、生产、销售于一体的专业品牌。主要致力于提供完善的手机保护类产品。TORRAS团队实力强大，由拥有丰富的实践经验的创意研发团队、资深设计团队及专业采购团队等共同组成。我们拥有自己的销售通道，所以我