c.shopxx.net/6.0/a65279ef-4451-4584-afd9-2c732659cd08.png','美的',1,'http://www.midea.com'),(22,'2019-07-12 00:06:03','2019-07-12 00:06:03',0,22,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 海信拥有海信电器(600060)和海信科龙(00921)两家分别在沪、深、港三地上市的公司，持有海信(Hisense)、科龙(Kelon)和容声(Ronshen)三个中国著名商标。海信目前在全球拥有13所生产基地、12所研发中心，面向全球引进高端人才，促进国内的设计、研发人员“走出去”。海外分支机构覆盖美洲、欧洲、非洲、中东、澳洲及东南亚等全球市场，产品远销130多个国家和地区。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 继2016年成为欧洲杯顶级赞助商，海信于2017年4月6日宣布成为2018年俄罗斯世界杯官方赞助商。</p>','http://image.demo.b2b2c.shopxx.net/6.0/18e35220-fe7f-45d1-9444-45c3881cd1d3.png','海信',1,'http://www.hisense.com'),(23,'2019-07-12 00:06:04','2019-07-12 00:06:04',0,23,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 四川长虹电子控股集团有限公司创始于1958年，公司前身国营长虹机器厂是我国“一五”期间的156项重点工程之一，是当时国内唯一的机载火控雷达生产基地。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2015年6月3日，四川长虹电器股份有限公司发出公告，称其控股股东四川长虹电子集团有限公司的公司名称已于6月3日变更为四川长虹电子控股集团有限公司(简称“长虹控股公司”)。其注册资本、经营范围也做了相应变更。2017年长虹品牌价值达1319.75亿元人民币。</p>','http://image.demo.b2b2c.shopxx.net/6.0/27d33756-22d1-4ed4-8d51-4785b002f449.png','长虹',1,'http://www.changhong.com'),(24,'2019-07-12 00:06:05','2019-07-12 00:06:05',0,24,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 海尔集团创业于1984年，是全球大型家电品牌，目前已从传统制造家电产品的企业转型为面向全社会孵化创客的平台。在互联网时代，海尔致力于成为互联网企业，颠覆传统企业自成体系的封闭系统，变成网络互联中的节点，互联互通各种资源，打造共创共赢新平台，实现攸关各方的共赢增值。</p>','http://image.demo.b2b2c.shopxx.net/6.0/7c6a1f68-8cf3-4ec0-940a-b70c83fb7351.png','海尔',1,'http://www.haier.com'),(25,'2019-07-12 00:06:06','2019-07-12 00:06:06',0,25,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; TCL集团股份有限公司创立于1981年，是全球化的智能产品制造及互联网应用服务企业集团。集团现有8万多名员工，23个研发机构，21个制造基地，在80多个国家和地区设有销售机构，业务遍及全球160多个国家和地区。其前身为中国首批13家合资企业之一——TTK家庭电器(惠州)有限公司，从事录音磁带的生产制造，后来拓展到电话、电视、手机、冰箱、洗衣机、空调、小家电、液晶面板等领域。</p>','http://image.demo.b2b2c.shopxx.net/6.0/476def94-1474-45a6-a03f-c2fddff96c60.png','TCL',1,'http://www.tcl.com'),(26,'2019-07-12 00:06:07','2019-07-12 00:06:07',0,26,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 松下(Panasonic)，是日本的一个跨国性公司，在全世界设有230多家公司，员工总数超过290,493人。其中在中国有54，000多人。2001年全年的销售总额为610多亿美元，为世界制造业500强的第26名。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Panasonic的中文为“松下”(早期叫National，1986年开始逐步更改为Panasonic，2008年10月1日起全部统一为Panasonic)由日本松下电器产业株式会社自1918年松下幸之助创业，发展品牌产品涉及家电、数码视听电子、办公产品、航空等诸多领域而享誉全球；该企业品牌跃入《世界品牌500强》排行榜。</p>','http://image.demo.b2b2c.shopxx.net/6.0/f5142cce-ced9-4dc6-a2e4-22b199e407ba.png','松下',1,'http://www.panasonic.cn'),(27,'2019-07-12 00:06:08','2019-07-12 00:06:08',0,27,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 科龙集团总部位于中国广东省佛山市顺德区，1984年始生产冰箱，是中国最早生产冰箱的企业之一。继1996年发行H股并在香港挂牌上市后，1999年科龙又成功在深圳发行A股，同年更被“世界经济论坛组织”推举为1999年全球新兴市场100家最佳企业之一；2001年被《财富》杂志评选为中国上市公司百强企业。科龙一贯注重科技领先，1996年因无氟电冰箱技术获得行业内屈指可数的国家科技进步奖，2000年因碳氢物质替代CFC制造系统再获行业内同类别唯一的国家科技进步奖。至2001年，科龙已有十项冰箱核心处于国内领先地位，其中有五项更高居世界领先地位。2003年，在全球环境基金(GEF)组织举办的“节能明星冰箱”大赛中，科龙一举夺魁，获得“节能明星”大奖，标志着科龙冰箱的节能环保已达世界领先水平。</p>','http://image.demo.b2b2c.shopxx.net/6.0/6471880b-e51b-40e1-a99b-309843c8e92e.png','科龙',1,'http://www.kelon.com'),(28,'2019-07-12 00:06:09','2019-07-12 00:06:09',0,28,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 康佳集团成立于1980年5月21日，前身是“广东光明华侨电子工业公司”，是中国改革开放后诞生的第一家中外合资电子企业，康佳集团主要从事彩色电视机、手机、白色家电、生活电器、LED、机顶盒及相关产品的研发、制造和销售，兼及精密模具、注塑件、高频头、印制板、变压器及手机电池等配套业务，是中国领先的电子信息企业。</p>','http://image.demo.b2b2c.shopxx.net/6.0/f5377926-ab9d-4b75-94e2-ce3b22f74583.png','康佳',1,'http://www.konka.com'),(29,'2019-07-12 00:06:10','2019-07-12 00:06:10',0,29,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 飞利浦，1891年成立于荷兰，主要生产照明、家庭电器、医疗系统方面的产品。飞利浦公司，2007年全球员工已达128,100人，在全球28个国家有生产基地，在150个国家设有销售机构，拥有8万项专利，实力超群。2011年7月11日，飞利浦宣布收购奔腾电器(上海)有限公司，金额约25亿元。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2011年10月17日，飞利浦电子发布了第三季度财报，第三季度净利润同比下滑85.9%；同时宣布，飞利浦将在全球范围内裁员4500人。2013年1月底，飞利浦消费电子业务已全部剥离，将聚焦优质生活，医疗和照明设备行业。北京时间2014年12月17日，飞利浦宣布，将以12亿美元收购美国医疗设备制造商Volcano公司。</p>','http://image.demo.b2b2c.shopxx.net/6.0/7f0a9957-cabb-434f-80e3-383e24e4d036.png','飞利浦',1,'http://www.philips.com.cn'),(30,'2019-07-12 00:06:11','2019-07-12 00:06:11',0,30,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 宁波奥克斯空调有限公司拥有1个企业工程技术中心，3个技术研究所，1个国家级博士后工作站，有强大的空调技术研发能力和改造能力。2005年以来，奥克斯空调与韩国三星、日本松下等国际研发机构强强联手，在兼收并蓄的交流合作中，不断提升企业的创新研发实力，从而保证产品始终处于行业领先水平。目前，我们的产品涉及了30多种规格200多个内销型号。奥克斯空调坚持以“优质平价”策略做市场，市场每年保持30%以上的增长率在飞速发展的同时，空调产品平直不断提升。“奥克斯空调”通过国家节能产品认证及澳洲能耗认证，获得了国家质检首批面见产品的称号，一次性通过了国家3C强制认证，通过了ISO9001:2008版质量管理体系认证审核。连续几年被业界评为“增长速度最快品牌”称号，并获得“出口免检”、“中国名牌[有效期2007年9月-2012年9月]”、“国家免验产品”、“中国驰名商标”、“节能产品”等荣誉称号。</p>','http://image.demo.b2b2c.shopxx.net/6.0/4b2e92de-986c-4c04-999c-e2c97f6d0eb1.png','奥克斯',1,'http://www.auxgroup.com'),(31,'2019-07-12 00:06:12','2019-07-12 00:06:12',0,31,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; lagogo，中文名“拉谷谷”。上海拉谷谷时装有限公司成立于2008年，是江苏华瑞国际集团旗下自主运营品牌。lagogo专业从事时尚女性服饰的设计、生产和销售，lagogo已拥有700多家专卖店及专柜，遍布全国大中城市。在北京、上海、广州、深圳等城市中， Lagogo已成为时尚女性所熟悉的知名品牌。</p>','http://image.demo.b2b2c.shopxx.net/6.0/af869b7b-fb33-432c-9aea-2f3b68da32ae.png','拉谷谷',1,'http://www.lagogo.cn'),(32,'2019-07-12 00:06:13','2019-07-12 00:06:13',0,32,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 南极人，成立于1997年, 是中国最早成立的内衣企业之一，首创保暖内衣产品，开创了中国内衣行业发展的新道路。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 历经18年的成长蜕变，南极人已经在内衣、母婴、服装、床品&amp;布艺、厨品、鞋品、服饰配件、户外、家电等9大品类的55大类目产品线中取得突出的成绩，签约国民好媳妇海清，共同为国人带来 “全品类消费品王国”，努力打造让用户尖叫的产品，创造极致的用户体验。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 南极人每年卖出上亿件/套的产品，为几亿人提供舒适、优质的日常生活所需。2014年双十一，南极人取得了单天1.8亿元的销售成绩，是南极人转型互联网企业后，模式创新的最强有力证明。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2016年双十一，南极人取得了5.4亿元的销售业绩，再次刷新了历史记录！</p>','http://image.demo.b2b2c.shopxx.net/6.0/c392d723-5dcb-4803-99cb-94c4d280a80a.png','南极人',1,'http://www.nanjiren.com.cn'),(33,'2019-07-12 00:06:14','2019-07-12 00:06:14',0,33,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ONLY是丹麦著名的国际时装公司BESTSELLER拥有的众多著名品牌之一。BESTSELLER集团成立于1975年。ONLY于1995年在丹麦创立，至今销售网点已拓展到了全球46个国家。<br>集团创立以来，已经拥有2000多家概念店和超过6000多家品牌时装零售店销售。主要市场包括丹麦、挪威、瑞典、德国、芬兰、荷兰、西班牙、法国，加拿大，英国等欧美国家。Bestseller的设计师遍布欧洲，总是站在世界潮流的前沿，为大都市的年轻人营造超级时尚概念。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ONLY在1996年来到中国，1996年9月28日，品牌诞生之初便富有远见地来到中国，从北京西单赛特的第一家店铺，到今日遍布中国大陆300多个城市共约1800家店铺。2000年对于ONLY有着品牌里程碑的意义，在这一年，ONLY首次在店铺中引进“快时尚”的定义，以保证款式始终引领潮流，这一概念流行至今并使ONLY成为众多欧洲时尚的领跑者。时尚感强的欧洲设计，让大胆而独立的都市女性通过服饰表现自我。</p>','http://image.demo.b2b2c.shopxx.net/6.0/f729972b-2078-453f-9772-50eea92d549d.png','ONLY',1,'http://www.only.cn'),(34,'2019-07-12 00:06:15','2019-07-12 00:06:15',0,34,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 恒源祥，首个以企业身份主办有“体坛奥斯卡”之称的“劳伦斯世界体育奖颁奖盛典”的中华老字号品牌企业，同时也是中国奥委会合作伙伴、赞助商。2014年6月9日，劳伦斯学会主席埃德温·摩西正式宣布恒源祥集团成为2015劳伦斯世界体育奖主办方；2015年4月15日，劳伦斯颁奖盛典在上海大剧院盛大开幕，千余名体育界、文娱明星出席盛典。盛典当晚，恒源祥与奔驰、万国表等品牌成为了焦点，百年老字号攀上了品牌事业发展的新高峰。</p>','http://image.demo.b2b2c.shopxx.net/6.0/31034318-e68c-4fbc-8274-1c3794549b45.png','恒源祥',1,'http://www.hyx1927.com'),(35,'2019-07-12 00:06:16','2019-07-12 00:06:16',0,35,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 拉夏贝尔(La Chapelle)品牌始创于1998年，是来自上海的经典之作。拉夏贝尔一直追求强调个性化的设计， 是将设计渗透人文文化的时尚品牌。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 拉夏贝尔设计和销售适合都市女性的流行时装和饰品，将法国浪漫、时尚、优雅的服饰文化引入到中国人的生活中。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 上海拉夏贝尔服饰有限公司在国内有自营店柜近5000家，并还在增长中。LA CHAPELLE 少淑品牌，主要针对25-35岁都市办公室女性设计，线条简洁，优雅精致。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; LA CHAPELLE SPORT 休闲品牌，主要针对20-30岁都市女性，健康、时尚、活力，是新一代女性追求浪漫、甜美和时尚运动的目标。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 拉夏贝尔具备法兰西的浪漫，展现女性自然、健康的生活方式。</p>','http://image.demo.b2b2c.shopxx.net/6.0/0d02bf59-ca49-4dcc-864b-36d51cba410e.png','拉夏贝尔',1,'http://www.lachapelle.cn'),(36,'2019-07-12 00:06:17','2019-07-12 00:06:17',0,36,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 朗姿，中国时尚品牌，拥有国际视野及国际影响力，致力成为成就“泛时尚生态圈”的互联网化和国家化的时尚产业集团。</p>','http://image.demo.b2b2c.shopxx.net/6.0/514ab258-5435-4140-a845-daba6f2ecfba.png','朗姿',1,'http://www.lancygroup.com'),(37,'2019-07-12 00:06:18','2019-07-12 00:06:18',0,37,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 洛诗琳luxlead, 一个雅致的名字，职场女性(0L)时装设计。<br>&nbsp; &nbsp; &nbsp;&nbsp; luxlead洛诗琳女装以全新形象牮美登场，邀大家共同进入“衣”个色彩斑拥的世界，共赴一场华丽盛荽。洛诗琳与咨智温柔、自然时尚、优雅浪漫、热爱生活的都市女性在气质和对时尚的追求上不谋而合:我们将继续为“洛诗琳”女人设计最适合“她们”的服饰。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 洛诗琳LUXLEAD，取自Beingluxurymodel,Leading fashion trend!(奢华典范，潮流领先！)LUXLEAD是法国著名设计师Louis Austin创立的高端女装品牌。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 设计理念<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; LUXLEAD立足于幸福生活的解读。巴黎优雅，塞纳河的不羁，格拉斯玫瑰的风情万种，共同将法国的时尚与浪漫演绎成流动的色彩，孕育了LUXLEAD品牌根植的生活土壤；源远流长的欧洲文明被聚拢、碾碎、消化、释放，最终浓缩为LUXLEAD品牌的设计理念，于是便诞生了最能体现女性优雅魅力的经典服饰。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; LUXLEAD将美学和潮流完美结合，针对25-40岁都是高品位女性，以优质面料、做工考究、款式典雅塑造优雅大气尊贵时尚的名媛典范。</p>','http://image.demo.b2b2c.shopxx.net/6.0/930d5b80-0e91-4767-be18-23db89543545.png','洛诗琳',1,'http://www.cetd.com.cn/luoshilin'),(38,'2019-07-12 00:06:19','2019-07-12 00:06:19',0,38,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 雪中飞羽绒服是波司登国际控股有限公司旗下的品牌。雪中飞以羽绒服为基础，并最终打造为最具影响力的动感新潮休闲服装品牌。</p>','http://image.demo.b2b2c.shopxx.net/6.0/54be491d-14ed-4671-bf77-481b6922bcb6.png','雪中飞',1,'http://www.bosideng.com'),(39,'2019-07-12 00:06:20','2019-07-12 00:06:20',0,39,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 鸭鸭集团坐落在庐山南麓，鄱阳湖畔，地理位置优越，水陆空立体交通便捷，水路有长江九江口岸，昌九高速公路、京九铁路穿境而过，相距三、四十公里的南昌、九江机场坐落两端。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; “鸭鸭”牌系列产品深受我国广大消费者青睐，屡获国家、省、部优产品称号，“鸭鸭”被认定为中国驰名商标、国家重点保护品牌，“鸭鸭”牌羽绒服被评为中国名牌产品、全国免检产品。</p>','http://image.demo.b2b2c.shopxx.net/6.0/7e692573-70fb-4d40-90ac-b2e3006332b4.png','鸭鸭',1,'http://www.yaya.com.cn'),(40,'2019-07-12 00:06:21','2019-07-12 00:06:21',0,40,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 韩都衣舍电商集团创立于2006年，是中国最大的互联网品牌生态运营集团之一。凭借“款式多，更新快，性价比高”的产品理念，深得全国消费者的喜爱和信赖。2016年7月获批成为互联网服饰品牌第一股，股票代码838711。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2010年获“十大网货品牌”以及“最佳全球化实践网商”的称号; 2012年—2016年，在国内各大电子商务平台，连续五年行业综合排名均排第一。2014年，韩都衣舍女装取得了天猫历史上第一个全年度、双十一、双十二“三冠王 ”，男装取得天猫原创年度第一名、童装列天猫原创年度第三名。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2011年3月，获得IDG近千万美元投资。2014年9月，获得由李冰冰，黄晓明，任泉三人成立的Star VC投资，系其首个投资项目。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 通过内部孵化、合资合作及代运营等，韩都衣舍品牌集群达70个，包含女装品牌HSTYLE、男装品牌AMH、童装品牌米妮·哈鲁、妈妈装品牌迪葵纳、文艺女装品牌素缕、美国户外品牌Discovery等知名互联网品牌，包括韩风系、欧美系、东方系等主流风格，覆盖女装、男装、童装、户外等全品类。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 韩都衣舍独创的“以产品小组为核心的单品全程运营体系(IOSSP)”是企业利用互联网提升运营效率的一个成功案例，入选清华大学MBA、长江商学院、中欧国际工商学院及哈佛商学院EMBA教学案例库。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2014年4月，韩都衣舍签约韩国巨星“国民女神”全智贤，10月签约“国民弟弟”安宰贤，2015年3月，签约新生代“亚洲女神”朴信惠，10月签约韩国实力派明星池昌旭。系中国拥有国际明星代言人最多的互联网企业。</p>','http://image.demo.b2b2c.shopxx.net/6.0/bb3a611b-f7b4-43bc-a924-9677776773d8.png','韩都衣舍',1,'http://www.handu.com'),(41,'2019-07-12 00:06:22','2019-07-12 00:06:22',0,41,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 红豆集团是江苏省重点企业集团,国务院120家大型深化改革试点企业之一，注册商标“红豆”是中国第一批驰名商标，红豆服装在全国服装行业中居领先地位。拥有总资产近30亿，2002年实现销售收入50.62亿元。2001年1月8日，红豆实业股份有限公司在上海证交所成功上市。</p>','http://image.demo.b2b2c.shopxx.net/6.0/b854736e-1224-4b02-b4f3-91383fd25377.png','红豆',1,'http://www.hongdou.com'),(42,'2019-07-12 00:06:23','2019-07-12 00:06:23',0,42,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 七匹狼品牌创立于1990年，是中国男装行业开创性品牌。2000年推出格子茄克，成为红遍大江南北的“茄克之王”，并在此后连续16年中国茄克市场占有率第一。2004年七匹狼实业股份有限公司作为中国服装业首家公司上市(股票代码：002029)。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 作为BrandZ最具价值中国品牌一百强，七匹狼在行业内率先系统提出“男人不只一面”的服装品牌文化经营理论，形成了以品牌为核心、以生活形态产业为主导的现代企业经营体系。在立足于对博大精深的中华传统文化积极挖掘的同时，七匹狼将西方流行时尚元素融于自身设计理念，并致力于推动中国传统文化与现代时尚创意产业的契合。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; “男人不只一面”，七匹狼以“品格男装”突显国际化品质和中西兼容的文化格调，以时尚传承经典，以中国面向世界。 2016年6月20日，米兰富有历史与盛名的圣巴拿巴回廊内，七匹狼2017年春夏狼文化大秀上演。这是七匹狼继2015年作为首个被米兰时装周官方邀请走秀的中国男装品牌登上米兰时装周之后，再次登上这个时尚领域的顶尖盛事。</p>','http://image.demo.b2b2c.shopxx.net/6.0/cbcc9af1-6b6a-40e1-9356-b12e18543ac2.png','七匹狼',1,'http://www.septwolves.com'),(43,'2019-07-12 00:06:24','2019-07-12 00:06:24',0,43,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 美尔雅Mailyard是湖北美尔雅股份有限公司旗下知名男装品牌，美尔雅西服是“中国十大名牌服装”、“中国十大名牌西服”，并荣获欧洲质量金奖。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 在自主品牌的建设中，美尔雅别具匠心地将生产宫廷礼服的经验和工艺“嫁接”到西装生产中，760道工序、200人共同缝制做一件西服，每一件美尔雅西服都是一件艺术品。在人体体型分类上，美尔雅服饰是国内外细分程度最高的厂家，将人体体型分为瘦、正常、微胖、偏胖、肥胖、超胖6类，每一类又细分出8个大小各异的型号，在国内市场中，美尔雅还会根据各个区域消费者习惯的不同，设计精确到0.1—0.2毫米的尺寸缩放。48套版型，无论胖瘦高矮的消费者，都能够切身体会到美尔雅服装“量身定做”的体贴入微，充分体现美尔雅独特的神韵和文化内涵。</p>','http://image.demo.b2b2c.shopxx.net/6.0/a2277335-e24a-44d3-b40b-e0975bf73db6.png','美尔雅',1,'http://www.mailyard.com.cn'),(44,'2019-07-12 00:06:25','2019-07-12 00:06:25',0,44,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 培罗蒙西服公司创建于1928年，半个多世纪以来，以西服、大衣为代表，凭藉技术精湛，选料新颖，风格独特而闻名中外。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 公司全套引进日本、意大利、德国的先进设备和流水线，把现代工艺同传统工艺完善结合，与中国纺大合作的西服研究所以及共同开发的服装智能综合应用系统确保了公司服装与面料的高科技含金量。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 在保持西服特色的前提下，公司又注重挖掘麾下的“春秋”、“协大祥”等老字号名牌西服、纺织面料商标的潜力，同时又涉足男士服饰的其他领域，培罗蒙T恤、内衣、标夹、衬衫、领带、皮鞋、袜品也日益为人们了解和喜爱。</p>','http://image.demo.b2b2c.shopxx.net/6.0/76c167e3-6d39-4ea3-b363-5a7dd571e75d.png','培罗蒙',1,'http://www.baromon.com.cn'),(45,'2019-07-12 00:06:26','2019-07-12 00:06:26',0,45,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 斯得雅(STAVA)品牌源自意大利。1992年，它诞生于意大利的托斯卡那(Tuscany)，由阿科斯帝尼(Acostyne)及其伙伴所创。成熟、高贵、典雅的品牌个性，使得斯得雅自一问世就备受青睐。经历了意大利各大时装展的风云际会之后，斯得雅逐渐广为人知，成为深受成功人士喜爱的品牌。继意大利的成功之后，斯得雅更以敏锐的眼光，稳健的步伐，在国际服装市场上迅速挺进。1993年，斯得雅开始拓展海外市场。1994年，斯得雅进入丹麦市场，受到挑剔的丹麦人的热烈欢迎。1995年进入俄罗斯、杜拜市场，业务范围从欧洲逐渐向亚洲延伸。</p>','http://image.demo.b2b2c.shopxx.net/6.0/3a1e560a-5e93-42b3-ab54-67c0c0ef5765.png','斯得雅',1,'http://www.stava.cn'),(46,'2019-07-12 00:06:27','2019-07-12 00:06:27',0,46,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 圣得西(集团)有限公司始创于1989年，公司主要从事西服、西裤、休闲上衣、茄克、T恤、休闲裤、毛衫、衬衣、皮具等男士正装和商务休闲系列化产品的开发、生产和销售，目前拥有“圣得西”、“圣奥威斯”等品牌。公司先后在巴黎、上海建立研发设计中心，引进意大利、日本、德国等国家20余条顶级生产线，聚结世界前沿的服装技术，为中国男士量身打造优雅、舒展的圣得西。历年来，圣得西以其款式新颖、面料精美、工艺精湛而著称，是目前国内高级男士正装和休闲装的代表。</p>','http://image.demo.b2b2c.shopxx.net/6.0/53f52b75-77d1-401e-aa3c-89ac03cc8380.png','圣得西',1,'http://www.sundance.cn'),(47,'2019-07-12 00:06:28','2019-07-12 00:06:28',0,47,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 阿玛尼( Armani) 是世界知名奢侈品牌，1975年由时尚设计大师乔治·阿玛尼(Giorgio Armani)创立于意大利米兰，他以使用新型面料及优良制作而闻名。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 阿玛尼品牌标志是由一只在往右看的雄鹰变形而成。</p>','http://image.demo.b2b2c.shopxx.net/6.0/b5e37c1a-7086-4a86-a15d-8c721c643260.png','阿玛尼',1,'http://www.armani.com'),(48,'2019-07-12 00:06:29','2019-07-12 00:06:29',0,48,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 达芙妮国际控股有限公司原名为永恩国际集团有限公司，于1990年，预见于中国优质鞋类市场具庞大潜力，该集团创立自有品牌“达芙妮”，制造及销售女装鞋类，成为中国最成功之国内品牌之一。 自1996年以来连续多年获颁赠最畅销国内产品之荣衔。现时，“达芙妮”分为“D28”及“D18”两大系列，目标顾客分别为20至45岁及15至30岁之女性。达芙妮也是希腊神话中的女神，参阅月桂女神达芙妮，她是河神女儿，被阿波罗追求时被变成月桂树。另有以该词命名的时尚品牌。</p>','http://image.demo.b2b2c.shopxx.net/6.0/8a37dbe5-b15b-4cfa-a1bf-fc8cde750dce.png','达芙妮',1,'http://www.daphne.com.cn'),(49,'2019-07-12 00:06:30','2019-07-12 00:06:30',0,49,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 百丽集团创建于1992年3月8日，在香港丽华鞋业贸易有限公司投资大陆兴建的生产加工企业的基础上，迅速发展起来的产销一体化集团企业，中国大陆著名的鞋业品牌连锁经营公司，香港美丽宝(集团)国际控股有限公司、美国NIKE(耐克)公司、欧洲ADIDAS(阿迪达斯)公司、美国NEWBALANCE(新百伦)公司、全球鞋业最大连锁网络之一BATA(巴塔)公司以及美国李维斯公司在中国最大的合作伙伴。</p>','http://image.demo.b2b2c.shopxx.net/6.0/8a7d505a-be21-4d2f-aada-3519141069d8.png','TATA',1,'http://www.tatashoes.com.cn'),(50,'2019-07-12 00:06:31','2019-07-12 00:06:31',0,50,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ECCO(爱步)，成立于1963年，是来自丹麦的鞋履品牌。产品涵盖男士系列、女士系列、休闲正装系列、户外系列、运动系列、高尔夫系列和儿童系列，同时还包括包袋配件、小皮件、鞋护产品等。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ECCO是为数不多达到资源垂直整合模式的制鞋公司之一——采用自上而下的营运模式——即从皮革原料的生产，到设计研发和产品制造，每一环节都由ECCO直接监管。迄今为止，ECCO已在全球87多个国家拥有超过14000家销售点；在中国，拥有超过1000个销售点。成立于1963年的丹麦知名家族企业，ECCO在全球各地拥有19000多名员工。ECCO也是好的皮革生产之一，其皮革不仅用于制作ECCO鞋履及皮具，也供应给多家奢侈品品牌。</p>','http://image.demo.b2b2c.shopxx.net/6.0/a0745f75-b486-4f74-8ee7-d7c254807703.png','爱步',1,'http://cn.ecco.com'),(51,'2019-07-12 00:06:32','2019-07-12 00:06:32',0,51,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 奥康公司以制鞋为主业，并涉足商业地产、生物制品、金融投资等领域。企业年产值40多亿元，创利税6亿多元，品牌价值165.92亿元。集团实行母子公司管理体制，下辖国内外18个子公司和事业部。公司现有员工2万多人，拥有三大鞋业生产基地、五大鞋业品牌。在全国设立了30多个省级公司、3000多家连锁专卖店、800多处店中店。主导产品“奥康”牌皮鞋陆续获中国真皮领先鞋王、中国名牌产品、中国驰名商标等称号，并成为中国皮鞋行业唯一的标志性品牌。现在，集团旗下的奥康皮鞋、康龙休闲鞋、美丽佳人时尚女鞋、红火鸟鞋业都被国家质检总局评为国家免检产品。根据国家统计局公布的信息，公司连续三年位居中国工业企业行业效益十佳企业第一位。</p>','http://image.demo.b2b2c.shopxx.net/6.0/ef36600f-dc09-4037-af8f-dc4c436bb807.png','奥康',1,'http://www.aokang.com'),(52,'2019-07-12 00:06:33','2019-07-12 00:06:33',0,52,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 意尔康(YEARCON)是意尔康股份有限公司的简称，始创于1995年，位于浙江省青田县，总裁单志敏。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1999年升格为无区域名称企业，2001年组建成企业集团，2011年完成股份制改制。总部位于浙江青田，拥有福建意尔康体育用品有限公司、意尔康鞋业(上海)有限公司和意尔康广东皮革制品有限公司三家全资子公司，在全国建有36家销售分公司和3000多家专卖店。</p>','http://image.demo.b2b2c.shopxx.net/6