2647.png','香奈儿',1,'http://www.chanel.cn'),(77,'2019-07-12 00:06:58','2019-07-12 00:06:58',0,77,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 自1854年以来，代代相传至今的路易威登，以卓越品质、杰出创意和精湛工艺成为时尚旅行艺术的象征 。产品包括手提包，旅行用品，小型皮具，配饰，鞋履，成衣，腕表，高级珠宝及个性化订制服务等。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2017年6月6日，《2017年BrandZ最具价值全球品牌100强》公布，路易威登名列第29位。</p>','http://image.demo.b2b2c.shopxx.net/6.0/0c3d1e2f-b30b-4de1-be96-0444ee2826c7.png','LV',1,'http://www.louisvuitton.cn'),(78,'2019-07-12 00:06:59','2019-07-12 00:06:59',0,78,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ELLE法语翻译成中文名字是“她”的意思，1945年，由Helene Lazareff在法国巴黎创立，面世后广受好评。ELLE已融入到女性生活的方方面面。以时尚导向，是女性化的、现代的、积极向上、亲切的、潮流而又充满生活气息。品牌形象：现代、朝气、优雅、活力。</p>','http://image.demo.b2b2c.shopxx.net/6.0/8e3dc8be-08c9-4132-a7f0-c834752eddd2.png','ELLE',1,'http://www.elleshop.com.cn'),(79,'2019-07-12 00:07:00','2019-07-12 00:07:00',0,79,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 菲拉格慕(Ferragamo) 是意大利的女鞋王国，1927年诞生。创造力、激情和韧性是Ferragamo家族恒久不变的价值观，并代代相传。因为Salvatore Ferragamo异常关注质量和细节，他赢得了\"明星御用皮鞋匠\"的称号。而今，Salvatore Ferragamo是皮鞋、皮革制品、配件、服装和香氛的世界顶级的设计者之一。风格华贵典雅，实用性和款式并重，以传统手工设计和款式新颖誉满全球。</p>','http://image.demo.b2b2c.shopxx.net/6.0/c41d9619-b064-430e-b7f2-4dcb0b01e408.png','Ferragamo',1,'http://www.ferragamo.cn'),(80,'2019-07-12 00:07:01','2019-07-12 00:07:01',0,80,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; MARUBI丸美，中国领先的护肤品企业，以卓越的眼部护理著称化妆品界，拥有全球最大最专业的眼部肌肤研究中心。在中国拥有超1000个百货公司专柜，超15000个精品加盟店，商业版图遍布全国，是国家级高新技术企业，中国驰名商标企业、中国最有价值品牌500强、全球100大美容品企业。2013年，LVMH旗下的LCapital基金战略投资丸美，进一步推动了丸美国际化品牌梦想的实现。</p>','http://image.demo.b2b2c.shopxx.net/6.0/8c6ecce9-6bf9-45f7-95cb-ca819c394650.png','丸美',1,'http://www.marubi.cn'),(81,'2019-07-12 00:07:02','2019-07-12 00:07:02',0,81,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 北京市康乃馨生物化妆品有限责任公司于1996年经国家立项建立，是国内专业生产生物技术改性明胶——酶解生物活性胶原蛋白类化妆品的高新技术企业，公司集科研、生产、贸易为一体，其所属企业分别设立在北京和杭州。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 公司产品主要原料酶解生物活性胶原蛋白是采用北京化工大学经历14年的科研成果。“水解明胶制备新技术及其制品的开发应用和推广”经北京医学院附属人民医院、上海华山医院等十大医疗单位临床应用证明了酶解生物活性胶原蛋白及其深加工制品的显著功效，此项成果荣获化工部“科技进步一等奖”，国家“科技进步二等奖”。 专注的态度和专业的眼光，以及优秀的人员配备，是康乃馨生物化妆品发展的基础，经过多年的钻研和努力，开发出与人体年轻肌肤结构十分相似的酶解生物技术活性胶原蛋白为主要原料的系列护肤产品，奏响了新世纪生物技术时代以生物仿生护肤品为主旋律的华彩乐章。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2012年，公司开始种植“中天”玫瑰，“中天”玫瑰是北京水木中天植物科学科学研究院历经十几年科研培育的具有知识产权的二次杂交新品种，该品种通过了科技部有关部门组织的科技成果鉴定和产业评估，获得4项发明专利。公司的科研人员把“中天”玫瑰这一护肤圣品加入到了紫薇的产品之中，研发出了活性胶原蛋白与玫瑰纯露相融合的绝佳护肤品，成功打入市场。其主打品牌PURPLE(紫薇)，凭借着“高品质、高品位”的定位，不断创新的精神、优秀的品质和良好的效果，赢得了消费者的好评和青睐。紫薇品牌迅速成长为中国抗衰修护类护肤品领先品牌，给国产化妆品品牌注入了新的活力，在化妆品行业中站稳了一席之地。</p>','http://image.demo.b2b2c.shopxx.net/6.0/caa31634-cb8a-4cc5-ba0e-98f214b84c12.png','紫薇',1,'http://www.konation.com.cn'),(82,'2019-07-12 00:07:03','2019-07-12 00:07:03',0,82,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; “百雀羚”是上海百雀羚日用化学有限公司(英文缩写：SPDC)旗下品牌，2008年曾获“中国驰名商标”称号此前“百雀羚”已连续两次获“上海市著名商标”。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 百雀羚创立于1931年，是国内屈指可数的历史悠久的著名化妆品厂商。悠久的历史，承载着光辉的业绩，成就了百雀羚品质如金的美誉。品牌曾被多次评选为“上海著名商标”，并荣获“中国驰名商标”等称号。公司先后与美国Disney、日本ASTRO BOY等国际公司合作，推出了迪士尼、阿童木等儿童护理产品系列。传承经典，勇于创新，公司致力于为消费者创造天然温和的优质护肤品，完美演绎“中国传奇，东方之美”。</p>','http://image.demo.b2b2c.shopxx.net/6.0/866f5789-bad0-4107-85a9-8e1f8542e5bc.png','百雀羚',1,'http://www.pechoin.com'),(83,'2019-07-12 00:07:04','2019-07-12 00:07:04',0,83,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 珀莱雅是中国领先的化妆品品牌，珀莱雅发掘深海纯净、珍贵的护养成分，运用先进科技，深入肌肤本源，带来持久、由内而外的魅力。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 品牌自2006年诞生以来，深信海洋是一切生命的摇篮，也是美丽之源，珀莱雅以“深度之美，源自深海”的理念以及知性、魅力、优雅、时尚的品牌个性，为亚洲广大消费者提供全面、深入的护肤方案和美丽体验，创造了富启发性的深海护肤美学。&nbsp;&nbsp;&nbsp;&nbsp; 2015年1月12号珀莱雅荣获联合国公益大奖“年度女性发展贡献奖”。2017年11月15日，珀莱雅登陆上海证券交易所。</p>','http://image.demo.b2b2c.shopxx.net/6.0/6fc9da7c-10c3-47bc-8664-ec0cb5ab1a0f.png','珀莱雅',1,'http://www.proya.com'),(84,'2019-07-12 00:07:05','2019-07-12 00:07:05',0,84,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 赛莱拉国际集团——全球内养外护健康美容领导者，创立于1995年，以生物科技为核心，应用于生物制药、医疗器械、检测试剂、健康食品、美容护肤品等领域。旗下拥有“赛莱拉、赛斯兰黛、康琪莱”等知名品牌，以连锁经营为主要商业模式，在全球范围内拥有数千家加盟店，为实现人们的健康美丽梦想提供优质的产品及服务。 赛莱拉集团总裁陈海佳先生，工商管理硕士，暨南大学特聘教授、研究员兼硕士生导师。2007年赴美国加州大学进修，现任全国工商联美容化妆品业商会副会长、广东省青年科学家协会常务副会长、广东生物医学工程学会副理事长，荣膺“广东省十大杰出青年”、“2012中华儿女年度人物”、“首届中国美容化妆品业十大功勋企业家”、“中华美业30年十大影响力人物”等称号。陈海佳先生敬业爱国、热心慈善，荣获了由宋庆龄基金会颁发的“爱心大使”荣誉称号，并获得了温家宝总理及西班牙萨帕特罗首相等国内外领导人接见。</p>','http://image.demo.b2b2c.shopxx.net/6.0/460e564c-49c0-40fd-9720-50a4f30fac1d.png','赛莱拉',1,'http://www.saliai.com'),(85,'2019-07-12 00:07:06','2019-07-12 00:07:06',0,85,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 水密码是丹姿集团旗下专业补水护肤品牌；包含海洋源萃、冰川矿泉、雪颜萃、绿茶控油、红石榴新活、透肌水润这六大系列,2013年水密码正式宣布杨幂成为其品牌代言人；双方共同启动了全新海洋源萃系列的发布仪式，最新发布的水密码海洋源萃系列，定位于中高端市场，外形拥有水滴形的立体专利设计，外包装用精致梦幻的蓝色凸显高品质和科技感。</p>','http://image.demo.b2b2c.shopxx.net/6.0/34dafdd0-c6fb-4727-957f-f97805327e7d.png','水密码',1,'http://www.wetcode.com.cn'),(86,'2019-07-12 00:07:07','2019-07-12 00:07:07',0,86,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 温碧泉，致力于为女性提供最优质的温泉矿物护肤，承袭来自温泉的神奇美肤能量，坚持在补水领域进行不懈探索与钻研，并与中、法、韩、意等全球多个领先护肤品研究及设计机构合作，融合来自世界的科技智慧，缔造温碧泉精纯、活性的每一瓶产品。“补水就用温碧泉“为您温柔开启最纯净的肌肤青春之旅，纯享只属于您的活力自信光芒。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 随着2012年温碧泉五星品牌战略发布，更是奠定了品牌持续性发展的基石，实现品牌质的飞跃。迄今，温碧泉已发展成为国内补水保湿护肤品行业的知名品牌。温碧泉也将伴随每一位新时代的女性成就“全新”的自我！</p>','http://image.demo.b2b2c.shopxx.net/6.0/9483a27d-572d-4e12-a13f-25d82dabd5c3.png','温碧泉',1,'http://www.wetherm.com'),(87,'2019-07-12 00:07:08','2019-07-12 00:07:08',0,87,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1872年资生堂在日本东京银座创立了第一家西式调剂药房。1897年科学性地开发出了以西洋药学处方为基础，名为红色蜜露(EUDERMINE)的化妆水。从此，资生堂便一直致力于美肌和秀发的研究，研发出了许多革新商品和美容方法。今天的资生堂不仅在日本，在世界范围内也受到众多消费者的喜爱，其产品已在全世界85个国家销售，成为亚洲第一、享誉全球的化妆品集团。</p>','http://image.demo.b2b2c.shopxx.net/6.0/02ad6b1c-7d78-4fd4-820d-cd1296769331.png','资生堂',1,'http://www.shiseido.com.cn'),(88,'2019-07-12 00:07:09','2019-07-12 00:07:09',0,88,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 自然堂2001年创立于上海，已成为中国知名化妆品牌之一，在中国女性护肤品类市场占据相当大的市场份额。自然堂倡导乐享自然，美丽生活的理念，针对中国人的文化、饮食和肌肤特点研制，融合自然界天然成分与创新技术，致力于为中国消费者提供更好更专业品质的产品和服务。</p>','http://image.demo.b2b2c.shopxx.net/6.0/98d50af5-5956-4cae-b20e-db7fdcff300c.png','自然堂',1,'http://www.chcedo.com'),(89,'2019-07-12 00:07:10','2019-07-12 00:07:10',0,89,'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 上海相宜本草研发中心秉承“本草护肤”的理念，汇集了优秀的中药学、药理学、分析学、化学工程学、应用化学、精细化工学和包装学等不同学科专业的科研人员。上海相宜本草研发中心拥有较为完整的化妆品研发实验室，囊括原料分析实验室、配方研发实验室、工艺研发实验室、功效评价实验室和包材研发实验室等。研发开展至始至终以严谨的本草护肤功效成份筛选、现代化生产工艺、科学的配方组成、皮肤生物学测试和包材测试等阶段，实现产品的安全、有效。</p>','http://image.demo.b2b2c.shopxx.net/6.0/5e80c8b7-f17c-4088-bc43-d2c79442dec2.png','相宜本草',1,'http://www.inoherb.com');

/*Table structure for table `businessattribute` */

DROP TABLE IF EXISTS `businessattribute`;

CREATE TABLE `businessattribute` (
  `id` bigint(20) NOT NULL,
  `createdDate` datetime NOT NULL,
  `lastModifiedDate` datetime NOT NULL,
  `version` bigint(20) NOT NULL,
  `orders` int(11) DEFAULT NULL,
  `isEnabled` bit(1) NOT NULL,
  `isRequired` bit(1) NOT NULL,
  `name` varchar(255) NOT NULL,
  `options` varchar(4000) DEFAULT NULL,
  `pattern` varchar(255) DEFAULT NULL,
  `propertyIndex` int(11) DEFAULT NULL,
  `type` int(11) NOT NULL,
  PRIMARY KEY (`id`)
